import math


rec_counter: int


def closest_pair(points) -> tuple[int, int]:
    global rec_counter
    # preparation: x-sort of points' array by x-coord:
    points = sorted(points, key=lambda p: p[0])
    # using divide and conquer strategy:
    rec_counter = 0
    d, ps = divide_and_conquer(points, 0, len(points))
    # returning the nearest points pair:
    return ps


def i_am_broot(points: list[tuple[int, int]]) -> tuple[int, tuple[tuple[int, int], tuple[int, int]]]:
    min_d = math.inf
    min_d_points = None
    for j in range(length := len(points)):
        for i in range(j + 1, length):
            if (d_ := distance_square(pj := points[j], pi := points[i])) < min_d:
                min_d = d_
                min_d_points = (pj, pi)
            else:
                # very important for performance!!!
                break
    return min_d, min_d_points


def distance_square(p1: tuple[int, int], p2: tuple[int, int]) -> int:
    return (p2[0] - p1[0]) ** 2 + (p2[1] - p1[1]) ** 2


def divide_and_conquer(points: list[tuple[int, int]], lb: int, rb: int):
    global rec_counter
    print(f'rec call; lb, rb = ({lb}, {rb})')
    rec_counter += 1
    # base case:
    if rb - lb <= 2:
        print(f'I am broot: ({lb}, {rb})')
        return i_am_broot(points[lb: rb + 1])
    # recurrent relation:
    middle_index = (lb + rb) // 2
    middle_point = points[middle_index]
    dl, psl = divide_and_conquer(points, lb, middle_index)
    dr, psr = divide_and_conquer(points, middle_index + 1, rb)
    d, min_d_points = (dl, psl) if dl <= dr else (dr, psr)
    # let us find the min distance in the middle strip:
    strip = []
    for i in range(lb, rb):
        if abs((p_ := points[i])[0] - middle_point[0]) ** 2 < d:
            strip.append(p_)
    # sorting strip array by y-coord:
    strip = sorted(strip, key=lambda p: p[1])
    # let us process the strip's points and find the minimal distance between them:
    d_strip, min_strip_d_points = i_am_broot(strip)
    print(f'd, min_d_points: {d, min_d_points}')
    print(f'd_strip, min_strip_d_points: {d_strip, min_strip_d_points}')
    return (d, min_d_points) if min_strip_d_points is None else ((d, min_d_points) if d < d_strip else (d_strip, min_strip_d_points))


